import React from 'react';
import {
    AppBar,
    Toolbar,
    Typography,
    Container,
    Paper,
    Button,
    Box,
  } from '@mui/material';
  
  const HomePage = () => {
    return (
      <>
        {/* Top AppBar */}
        <AppBar position="static" color="primary">
          <Toolbar>
            <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
              Hen & Eggs
            </Typography>
            <Button color="inherit" variant="outlined">Login</Button>
          </Toolbar>
        </AppBar>
  
        {/* Main Content */}
        <Container maxWidth="md" sx={{ my: 4 }}>
          <Paper elevation={3} sx={{ p: 4 }}>
            <Typography variant="h4" gutterBottom>
              Welcome to Hen & Eggs
            </Typography>
            <Typography variant="body1" gutterBottom>
              Discover fresh farm eggs straight from happy hens. We value quality, warmth, and organic goodness.
            </Typography>
            <Box mt={3}>
              <Button variant="contained" color="secondary">
                Learn More
              </Button>
            </Box>
          </Paper>
        </Container>
      </>
    );
  };
  
export default Home;
